import React from 'react';
import './style.css';

const Footer = props => {
    return (

<footer className="footer">
<div className="footer-content">
    <a href="https://www.nutanix.com/"><img src="/img/Nutanix_White.png" alt="Logo" className="logo" /></a>
    <p className="copy-right">Â© Nutanix 2019</p>
    <div>
        <ul className="menu-social">
            <a href="http://www.twitter.com/nutanix" title="Twitter" rel="noopener" target="_blank"><img className="social-icon" src="/img/twitter-1-48.png" alt="twitter-logo" /></a>
            <a href="http://www.facebook.com/nutanix" rel="noopener" target="_blank" title="Facebook"><img className="social-icon" src="/img/facebook-6-48.png" alt="facebook-logo" /></a>
            <a href="https://plus.google.com/communities/106880237663842348187" rel="noopener" target="_blank" title="Google Plus"><img src="/img/google-plus-1-48.png" alt="google-plus-logo" /></a>
            <a href="http://www.linkedin.com/company/nutanix?trk=hb_tab_compy_id_735085" rel="noopener" target="_blank" title="Linkedin"><img className="social-icon" src="/img/linkedin-1-48.png" alt="linkedin-logo" /></a>
        </ul>
    </div>
</div>
</footer>
    )
};

export default Footer;
